function Store(props) {
    return (
        <div id="store">
            <h1> Store</h1>
            <ul className="store--item-list" >
                {props.products.map(product => (
                    <li>
                        {product.name}
                        {<img src={"./assets/{product.id}.svg"} />}
                        {<button> Add to cart</button>}

                    </li>
                )

                )}

            </ul>
        </div>
    )
}

export default Store
